import { Link } from "react-router-dom";
import './App.css';
import Button from 'react-bootstrap/Button';

function App() {
  return (
    <div>
      <h1>Bookkeeper!</h1>
      <nav
        style={{
          borderBottom: "solid 1px",
          paddingBottom: "1rem",
        }}
      >
        <Link to="/invoices">
          <Button variant="primary">Invoices</Button>
        </Link>

        <Link to="/expenses">Expenses</Link>
      </nav>
    </div>
  );
}

export default App;
